import React from 'react';
import Navstuff from './components/Navstuff';

import {
  TaggedContentCard,
} from 'react-ui-cards';

function App() {
  return (
    <div>
  <Navstuff />

        <TaggedContentCard
          href='https://github.com/nukeop'
          thumbnail='https://i.imgur.com/yCch7GN.jpg'
          title='Shop Name'
          description='Shop Description'
          tags={[
            'tag1',
            'tag2',
            'tag3'
          ]}/>
  </div>


  );
}

export default App;
